import React, { useState ,useEffect} from 'react'

const Challenge1 = () => {

    const [num , setnum] = useState(0);
    const [nums , setnums] = useState(0);
  
    useEffect(() =>{
        alert('I am Click');
        console.log('Clicked');
    },[num])

    return(
        <>
         <button onClick={(() =>{
           setnum(num + 1);
         }
         )}
         >
           click me {num} </button>
           <br />
           <button onClick={(() =>{
           setnums(nums + 1);
      
         }
         )}
         >
           click me {nums} </button>
        </>
  );
}

export default Challenge1
